import React, { useState, useEffect } from "react";
import axios from 'axios';

const CommunityPage = () => {
  const [postsData, setPostsData] = useState({ category_name: "", posts: [] });

  useEffect(() => {
    const fetchPosts = async () => {
      try {
        const response = await axios.get('http://43.200.226.225/intern/community/postlist/');
        setPostsData(response.data);
      } catch (error) {
        console.error('Error fetching posts:', error);
      }
    };

    fetchPosts();
  }, []);

  return (
    <div>
      <h1>{postsData.category_name} 게시글</h1>
      {postsData.posts.map((post) => (
        <div key={post.id} style={{ border: '1px solid #ccc', margin: '10px', padding: '10px' }}>
          <h2>{post.title}</h2>
          <p>{post.content}</p>
          <p>작성자: {post.author_id || '익명'}</p>
          <p>작성일: {new Date(post.created_at).toLocaleDateString()}</p>
          <p>좋아요: {post.likes}</p>
        </div>
      ))}
    </div>
  );
};

export default CommunityPage;
